import { Menu, Dropdown, Icon } from 'antd';
import React, { Component } from 'react'

const menu = (
    <Menu>
        <Menu.Item key="0">
            个人中心
        </Menu.Item>
        <Menu.Item key="1">
            我的消息
        </Menu.Item>
        <Menu.Divider />
        <Menu.Item key="3" >
            退出
      </Menu.Item>
    </Menu>
);

export default class HeaderDropdown extends Component {
    render() {
        return (
            <Dropdown overlay={menu} style={{
                background: 'pink',
                position: 'absolute',
                top: 0,
                right: 0
            }}>
                <a className="ant-dropdown-link" onClick={e => e.preventDefault()}>
                    用户名 <Icon type="down" />
                </a>
            </Dropdown>
        )
    }
}
